pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract MultiSender {

    //Token transfer
    IERC20 token;

    constructor() {
    }

    //Returns total value of transaction transfer
    function sum(uint[] memory amounts) internal returns(uint totalAmount){
        totalAmount = 0;

        for (uint i=0; i < amounts.length; i++) {
            totalAmount += amounts[i];
        }
    }

    //Perform multi Sender Transfer
    function multiSender(address payable[] memory addrs, 
         uint[] memory amounts,
         address token_addr
        ) external payable {
        require(addrs.length == amounts.length, "Amount of addresses or transfer values are wrong");
        require(sum(amounts) >= msg.value, "Not enough funds send for transfer!");

        //Initialize token
        token = IERC20(token_addr);

        for (uint i=0; i < addrs.length; i++) {
            //send the specified amount to the recipient
            token.transfer(addrs[i], amounts[i]);
        }
    }  
}

